function busquedaLineal(arr, objetivo) {
    for (let i = 0; i < arr.length; i++) {
        if (arr[i] === objetivo) {
            return i; // Retorna el ndice donde se encontr
        }
    }
    return -1; // No encontrado
}

// Bsqueda binaria iterativa - O(log n)
function busquedaBinaria(arr, objetivo) {
    let inicio = 0;
    let fin = arr.length - 1;
    
    while (inicio <= fin) {
        const medio = Math.floor((inicio + fin) / 2);
        
        if (arr[medio] === objetivo) {
            return medio;
        } else if (arr[medio] < objetivo) {
            inicio = medio + 1;
        } else {
            fin = medio - 1;
        }
    }
    
    return -1;
}

// Bsqueda binaria recursiva
function busquedaBinariaRecursiva(arr, objetivo, inicio = 0, fin = arr.length - 1) {
    if (inicio > fin) {
        return -1;
    }
    
    const medio = Math.floor((inicio + fin) / 2);
    
    if (arr[medio] === objetivo) {
        return medio;
    } else if (arr[medio] < objetivo) {
        return busquedaBinariaRecursiva(arr, objetivo, medio + 1, fin);
    } else {
        return busquedaBinariaRecursiva(arr, objetivo, inicio, medio - 1);
    }
}

// Bsqueda del primer/ltimo elemento en arreglo con duplicados
function buscarPrimero(arr, objetivo) {
    let inicio = 0;
    let fin = arr.length - 1;
    let resultado = -1;
    
    while (inicio <= fin) {
        const medio = Math.floor((inicio + fin) / 2);
        
        if (arr[medio] === objetivo) {
            resultado = medio;
            fin = medio - 1; // Continuar buscando hacia la izquierda
        } else if (arr[medio] < objetivo) {
            inicio = medio + 1;
        } else {
            fin = medio - 1;
        }
    }
    
    return resultado;
}

// Bsqueda interpolada - O(log log n) para datos uniformemente distribuidos
function busquedaInterpolada(arr, objetivo) {
    let inicio = 0;
    let fin = arr.length - 1;
    
    while (inicio <= fin && objetivo >= arr[inicio] && objetivo <= arr[fin]) {
        if (inicio === fin) {
            return arr[inicio] === objetivo ? inicio : -1;
        }
        
        // Estimacin de la posicin usando interpolacin
        const pos = inicio + Math.floor(
            ((objetivo - arr[inicio]) / (arr[fin] - arr[inicio])) * (fin - inicio)
        );
        
        if (arr[pos] === objetivo) {
            return pos;
        } else if (arr[pos] < objetivo) {
            inicio = pos + 1;
        } else {
            fin = pos - 1;
        }
    }
    
    return -1;
}

